import { __decorate } from "tslib";
import { Component } from '@angular/core';
let VolunteerListingComponent = class VolunteerListingComponent {
    constructor(volunteers) {
        this.volunteers = volunteers;
        this.page = 0;
        this.pageSize = 10;
        this.options = {
            filter: [],
            sort: { prop: "email", dir: "asc" }
        };
        this.rows = [];
    }
    async ngOnInit() {
        await this.fetchVolunteers();
    }
    async fetchVolunteers() {
        const result = await this.volunteers.fetch(this.page, this.pageSize, this.options);
        if (!result.success)
            return;
        this.rows = result.payload.items;
        console.log(result);
    }
};
VolunteerListingComponent = __decorate([
    Component({
        selector: 'app-volunteer-listing',
        templateUrl: './volunteer-listing.component.html',
        styleUrls: ['./volunteer-listing.component.css']
    })
], VolunteerListingComponent);
export { VolunteerListingComponent };
